import "bootstrap/dist/css/bootstrap.min.css";
import { Button } from "react-bootstrap";
import "./NavBarDesktop.css";
import  React, {useState} from 'react';
const NavBarDesktop = () => {

  return (
    <div className="nav-bar-desktop">
      <div className="logo">
        <div className="logodefault2">
          <div className="logodefault-inner" />
          <img className="logosaas-icon2" alt="" src="/logosaas@2x.png" />
        </div>
        <div className="made-by1">made by</div>
        <img
          className="black-horizontal-1-icon1"
          alt=""
          src="/blackhorizontal-1.svg"
        />
      </div>


      <div className="stack4">

       <li className="nav-item"> <label className="about1">About</label> </li>
       <li> <label className="about1">Features</label></li>
       <li> <label className="about1">Customers</label></li>
       <li>  <label className="about1">Updates</label></li>
       <li> <label className="about1">Help</label> </li>
         <Button variant="light">Get for free</Button> 

      </div>


      </div>

  );
};

export default NavBarDesktop;
